import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import { useLocation } from 'react-router-dom';
import Header from "../estructura/Header";
import Footer from "../estructura/Footer";
import Swal from 'sweetalert2';


const BodyCorreo = {
  backgroundColor: "#343a40",
  color: "#fff",
  paddingTop: "5rem",
};

const cardCorreo = {
  backgroundColor: "#424242",
  borderColor: "#333",
  borderRadius: "1rem",
  boxShadow: "0 0.5rem 1rem rgba(0, 0, 0, 0.3)",
  padding: "2rem",
  margin: "auto",
  maxWidth: "25rem",
};

const card_headerCorreo = {
  borderBottom: "none",
  textAlign: "center",
};

const card_footerCorreo = {
  borderTop: "none",
  textAlign: "center",
};

const form_controlCorreo = {
  backgroundColor: "#545454",
  border: "none",
  borderRadius: "0.5rem",
  color: "#fff",
  marginBottom: "1rem",
  padding: "0.75rem",
};

const btn_primaryCorreo = {
  backgroundColor: "#007bff",
  borderColor: "#007bff",
  borderRadius: "0.5rem",
  fontSize: "1rem",
  fontWeight: "600",
  padding: "0.75rem 2rem",
};

const CheckPass = () => {

  const navigate = useNavigate();

  const [password, setPassword] = useState("");
  const [pass2, setPass2] = useState("");

  const handlePass = async (event) => {
    event.preventDefault();

    // if (codigo == '') {
    //   Swal.fire({
    //     title: "Error",
    //     text: "Debe ingresar un codigo",
    //     icon: "error",
    //     confirmButtonText: "Cerrar",
    //   });
    // } else {
    //   if (code.code == codigo) {
    //     navigate("/")
    //   } else {
    //     Swal.fire({
    //       title: "Error",
    //       text: "El codigo es incorrecto",
    //       icon: "error",
    //       confirmButtonText: "Cerrar",
    //     });
    //   }
    // }
  };

  return (
  <div>
    <Header />
    <div style={BodyCorreo}>
      <div class="container">
        <div class="row justify-content-center">
          <div class="col-lg-6">
            <div style={cardCorreo}>
              <div style={card_headerCorreo}>
                <h4>Recuperacion de contraseña</h4>
                {/* <p>id: {code.id}</p> */}
                {/* <p>id: {code.code}</p> */}
              </div>
              <div class="card-body">
                <form onSubmit={handlePass}>
                  <div class="form-group">
                    <label for="correo">
                      Ingresa el codigo que hemos enviado al correo proporcionado
                    </label>
                    <input
                      type="emial"
                      name="correo"
                      style={form_controlCorreo}
                      id="correo"
                      aria-describedby="emailHelp"
                      placeholder="Ingrese su correo electronico"
                      value={password}
                      onChange={(event) => setPassword(event.target.value)}
                    />
                  </div>
                  <div class="form-group">
                    <label for="nuevaPass">Ingresa la nueva contraseña</label>
                    <input
                      type="password" class="form-control" name="nuevaPass" id="nuevaPass" placeholder="Ingrese su contraseña"
                    />
                  </div>
                  <div class="form-group">
                    <label for="confirmPass">Confirma la contraseña</label>
                    <input
                      type="password" class="form-control" name="confirmPass" id="confirmPass" placeholder="Confirme su contraseña"
                    />
                  </div>
                  <button type="submit" class="btn btn-primary btn-block">
                    Verificar
                  </button>
                </form>
              </div>

            </div>
          </div>
        </div>
      </div>
    </div>
    <Footer />
  </div>
);
};
export default CheckPass
